                        <li><strong>Like (%\u842C\u7528)</strong>\uFF1A% \u4EE3\u8868\u4EFB\u610F\u5B57\u5143 (\u4F8B: "H%Y" \u627E\u5230 "HAPPY", "HEY")</li>
