                        <li><strong>Like (%\u30EF\u30A4\u30EB\u30C9\u30AB\u30FC\u30C9)</strong>\uFF1A% \u306F\u4EFB\u610F\u306E\u6587\u5B57\u3092\u8868\u3059 (\u4F8B: "H%Y" \u3067 "HAPPY", "HEY" \u3092\u691C\u7D22)</li>
